import React from 'react';

// material-ui
import { CardContent, Checkbox, FormControlLabel, Grid, MenuItem, TextField } from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';
import SubCard from '../../../../../ui-component/cards/SubCard';

// select options
const cities = [
    {
        value: '1',
        label: 'Los Angeles'
    },
    {
        value: '2',
        label: 'Chicago'
    },
    {
        value: '3',
        label: 'Phoenix'
    },
    {
        value: '4',
        label: 'San Antonio'
    }
];

const countries = [
    {
        value: '1',
        label: 'India'
    },
    {
        value: '2',
        label: 'France'
    },
    {
        value: '3',
        label: 'USA'
    },
    {
        value: '4',
        label: 'UAE'
    }
];


const Details = () => {
    const [city, setCity] = React.useState('1');
    const handleChangeCity = (event) => {
        setCity(event.target.value);
    };

    const [Country, setCountry] = React.useState('1');
    const handleSelectChange1 = (event) => {
        setCountry(event.target.value);
    };

    const [state1, setState1] = React.useState({
        checkedA: true
    });
    const handleChangeState1 = (event) => {
        setState1({ ...state1, [event.target.name]: event.target.checked });
    };
    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={8} sm={8} lg={8} md={8}>
                <TextField type='number' fullWidth label='Date' defaultValue='' />
            </Grid>

            <Grid item xs={8} sm={8} lg={8} md={8}>
                <SubCard title=''>
                    <CardContent>
                        <Grid container spacing={gridSpacing}>
                            <Grid item xs={8} sm={8} lg={8} md={8}>
                                <TextField fullWidth label='Service Recipient Travel' defaultValue='' />
                            </Grid>
                            <Grid item xs={8} sm={8} lg={8} md={8}>
                                <TextField type='number' fullWidth label='Functional Center' defaultValue='' />
                            </Grid>
                        </Grid>
                    </CardContent>
                </SubCard>
            </Grid>


        </Grid>
    );
};

export default Details;
